import React from 'react';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';
const Note = () => {
  return (
    <>
      <div className="note">
        <h1>Title</h1>
        <br />
        <p>This is the content</p>
        <DeleteOutlineIcon className="delete-icon" />
      </div>
    </>
  );
};

export default Note;
